#function to fetch recommended games and soft cosine similarity score as per the game passed to it
def get_recommendations(name):
    rec = []
    score = []
    print("the product selected is {}".format(name))

    idl = p.index.tolist()

    a = cosine_similarities.getcol(idl.index(name))

    val = list(enumerate(a.data))

    #print(val)

    b= dict(val)

    print(len(b))

    c = sorted(b.items(),key=lambda x:x[1],reverse=True)[1:21]
    #print(c[2][1])
    i=0
    for idx in c:
        #print(idx)
        rec.append(p.index[idx[0]])
        score.append(c[i][1])
        i=i+1
    return rec, score

