def send_email(text, emailtext):
  subject = "Video Game Recommendation report requested by you!!"
  body = text
  sender_email = "recvideogame8@gmail.com"
  receiver_email = emailtext
  password = "Kotkot@123"

  message = MIMEMultipart()
  message["From"] = sender_email
  message["To"] = receiver_email
  message["Subject"] = subject
  message["Bcc"] = receiver_email

  text = message.as_string()

